import React ,{useState}from "react";
import Swal from 'sweetalert2';
import withReactContent from 'sweetalert2-react-content';





function Popupp(){
  
    return(
            
              
                Swal.fire({
                  title: 'Error!',
                  text: 'Do you want to continue',
                  type: 'error',
                  confirmButtonText: 'Cool'
                })
              
             
    )
}

export default Popupp;
